package gcompress_test

import (
	"bytes"
	"encoding/base64"
	"fmt"
	gerr "github.com/snail007/gmc/module/error"
	gcompress "github.com/snail007/gmc/util/compress"
	assert "github.com/stretchr/testify/assert"
	"os"
	"testing"
)

var (
	pkg = ""
)

func TestUnTarGz(t *testing.T) {
	assert := assert.New(t)
	d, e := base64.StdEncoding.DecodeString(pkg)
	assert.Nil(e)
	var b bytes.Buffer
	b.Write(d)
	s, e := gcompress.Unpack(&b, "test")
	fmt.Println(s, gcore.Providers.Error("")().StackError(e))
	assert.Nil(e)
	os.RemoveAll("test")
}
